import { useState, useEffect } from "react";


const Contact = () => {
  interface checkboxProps {
    target?:any,
    id?:string,
  }
  const [isChecked, setIsChecked] = useState<boolean>(false);

  const isOutofOrder = (event: checkboxProps) =>{
    let elId = event.target.id;
    setIsChecked(true);
  }

  useEffect(() => {
    //isOutofOrder(true);
  }, []);

  return(
    <>
      <p>Here's how you can contact me:</p>
      <div>
      <h3>Control Panel</h3>
      <p>The checkbox is {isChecked ? "checked" : "unchecked"}</p>
      <div>
        <input onChange={isOutofOrder} checked={isChecked} type="checkbox" id="sheets-status" />
        <span id="sheets-station" style={{ backgroundColor:isChecked ? "red" : ""}} >SHEETS</span>
      </div>
      <div> 
        <input onChange={isOutofOrder} type="checkbox" checked={isChecked} id="beams-status" /> 
        <span id="beams-station" style={{ backgroundColor: isChecked ? "red" : ""}} >BEAMS</span>
      </div>
      <div> 
        <input onChange={isOutofOrder} type="checkbox" checked={isChecked} id="bolts-status" />
        <span id="bolts-station" style={{ backgroundColor: isChecked ? "red" : ""}}>BOLTS</span>
      </div>
      <div> 
        <input onChange={isOutofOrder} type="checkbox" checked={isChecked} id="frames-status" />
        <span id="frames-station" style={{ backgroundColor: isChecked ? "red" : ""}} >FRAMES</span>
      </div>
    </div>
    </>

  );
}

export default Contact;
